import Layout from "../components/Layout"
import Head from "next/head"
import Link from "next/link"

export default class Leaderboard extends React.Component{
  constructor(props){
    super(props)

    this.state = {
      loaded: false,
      servers: []
    }
  }

  parseLeaderboard(){

  }

  componentDidMount(){
    if(this.state.loaded == false){
      this.setState({
        loaded: true,
        servers: [{
          name: 'name',
          image: '',
          description: `This person hasn't put in a description for their server, so this is the default description. Make sure to tell them to change it into something more soothing.`,
          id: 2
        },
        {
          name: 'name',
          image: '',
          description: `This person hasn't put in a description for their server, so this is the default description. Make sure to tell them to change it into something more soothing.`,
          id: 1
        }]
      })
    }
  }

  render(){

  return (
    <Layout style={{ textAlign: 'center'}}>

      <style jsx>{`
        .server{
          display: inline-block;
          border: 2px solid;
          border-radius: 10px 10px;
          width: 230px;
          height: 320px;
          padding: 10px 10px;
          margin-left: 5px;
        }
      `}</style>
      <Head>
        <title>Bread - Leaderboard</title>
      </Head>

      <br/>
      <form onSubmit={this.parseLeaderboard}>
        <input type="search" placeholder="Server Name/ID" required />
      </form>

      <div id="featuredServers">
        {
          this.state.loaded ? (
            this.state.servers.map((s)=>{
              return (
                <div className="server">
                  <img src={s.image}/>
                  <Link href={`/leaderboard/${s.id}`}><a><h2>{s.name}</h2></a></Link>
                  <p>{s.description}</p>
                </div>
              )
            })
          ) : (
            <p>Loading...</p>
          )
        }
      </div>
    </Layout>
  )
  }
}
